import "./home.css";


function Home() {
    return (
        <div className="home">
            <div className="left-graphic">
                <img src={require("../img/globe.png")} width="400px" alt="globe" />
            </div>
            <div className='right-intro'>
                <h1>Country News App</h1>
                <p>Explore the local news of countries around the world, and filter articles to find the one you want.</p>
            </div>
        </div>
    )
}

export default Home;
